  false,\n\t\"url\": null,\n\t\"notes\": \"This is a refuge survey effort that documents
  actual size of the Refuge breeding population and captures long-term trend data
  to inform the Pacific Flyway.The survey supports several management objectives,
  derived from the Malheur NWR CCP (2013). In accordance with 522 DM 1 (Adaptive Management
  [AM] Implementation policy), refuges staffs shall utilize    AM for conserving,
  protecting, and, where appropriate, restoring refuge lands and resources. An AM
  approach requires conducting surveys to determine resource status, promote learning,
  and evaluate progress toward achieving objectives (522 DM 1.5A).\",\n\t\"license_title\":
